// ===============================
// ğŸµ éŸ³ä¹é£æ ¼æ—¶é—´è½´ï¼ˆD3 v7, ESM ç‰ˆæœ¬ï¼‰â€” ä»… Folk & Popular
// ===============================
import * as d3 from "d3";
import data from "./assets/music_genres_full_with_scraped_info.json";

const svg = d3.select("#timeline-svg");
const margin = { top: 40, right: 40, bottom: 40, left: 160 };
const width = svg.node().clientWidth - margin.left - margin.right;
let height = svg.node().clientHeight - margin.top - margin.bottom;

const g = svg.append("g").attr("transform", `translate(${margin.left},${margin.top})`);

const tooltip = d3.select("#timeline-tooltip");
const legendContainer = d3.select("#timeline-legend");

// ğŸ¨ è°ƒè‰²æ¿
const color = d3.scaleOrdinal(d3.schemeTableau10);

// ===============================
// âš™ï¸ è¿‡æ»¤æ¡ä»¶
// ===============================
// ä»…æ˜¾ç¤ºè¿™äº›ä¸»ç±»ï¼ˆå¤§å°å†™ä¸æ•æ„Ÿï¼‰
const INCLUDED_CATEGORIES = new Set(["folk", "popular"]);
// å¹´ä»£è·¨åº¦å°äºæ­¤å€¼ï¼ˆå•ä½ï¼šå¹´ï¼‰çš„æ¡ç›®ä¸æ˜¾ç¤º
const MIN_DURATION = 20;

// ===============================
// ğŸ§© æ•°æ®æ•´ç†ï¼ˆä»… Folk & Popularï¼‰
// ===============================
const allGenres = [];

data.forEach((cat) => {
  const catKey = String(cat.category || "").toLowerCase();
  if (!INCLUDED_CATEGORIES.has(catKey)) return; // åªä¿ç•™ Folk / Popular

  cat.subcategories?.forEach((sub) => {
    sub.genres?.forEach((g) => {
      const rawYears = g.scraped_info?.years;
      let start = null, end = null;

      if (Array.isArray(rawYears) && rawYears.length > 0) {
        start = parseInt(rawYears[0]);
        end = parseInt(rawYears[1] || rawYears[0]) || start + 50;
      } else if (typeof rawYears === "string") {
        const m = rawYears.match(/(\d{3,4})\D*(\d{3,4})?/);
        if (m) {
          start = parseInt(m[1]);
          end = parseInt(m[2]) || start + 50;
        }
      }

      if (start && !isNaN(start) && end && end - start >= MIN_DURATION) {
        allGenres.push({
          category: cat.category,                  // åŸå§‹å¤§å°å†™
          subcategory: sub.subcategory,
          name: g.name,
          start,
          end,
          duration: end - start,
          location: g.scraped_info?.location || "æœªçŸ¥åœ°åŒº",
          origin: g.scraped_info?.cultural_origins || "",
        });
      }
    });
  });
});

if (!allGenres.length) {
  g.append("text")
    .attr("x", width / 2)
    .attr("y", height / 2)
    .attr("text-anchor", "middle")
    .attr("fill", "#888")
    .text("âš ï¸ æœªæ‰¾åˆ° Folk / Popular ç±»åˆ«ä¸­ç¬¦åˆæ¡ä»¶çš„æ•°æ®");
  throw new Error("æ²¡æœ‰ç¬¦åˆæ¡ä»¶çš„æ•°æ®ï¼ˆä»… Folk / Popularï¼‰");
}

// ä¼˜å…ˆæŒ‰ç±»åˆ«åˆ†ç»„ï¼Œå†æŒ‰èµ·å§‹å¹´ä»½æ’åº
allGenres.sort((a, b) => {
  if (a.category !== b.category) return d3.ascending(a.category, b.category);
  return d3.ascending(a.start, b.start);
});

// ===============================
// ğŸ§­ åæ ‡è½´ä¸å°ºåº¦ï¼ˆå«åŠ¨æ€é«˜åº¦ï¼‰
// ===============================
const categories = Array.from(new Set(allGenres.map((d) => d.category)));
color.domain(categories);

// åŠ¨æ€é«˜åº¦ï¼šæ¯æ¡ 22pxï¼Œæœ€å°‘ 420px
const dynamicHeight = Math.max(420, allGenres.length * 22);
height = dynamicHeight;
svg.attr("height", height + margin.top + margin.bottom);

const x = d3
  .scaleLinear()
  .domain([
    d3.min(allGenres, (d) => d.start) - 50,
    d3.max(allGenres, (d) => d.end) + 50,
  ])
  .range([0, width]);

const subcats = Array.from(new Set(allGenres.map((d) => `${d.category} â€º ${d.subcategory}`)));
const y = d3.scaleBand().domain(subcats).range([0, height]).padding(0.38); // æ›´å¤§ padding å‡é‡å 

// æ¨ªè½´
g.append("g")
  .attr("transform", `translate(0,${height})`)
  .call(d3.axisBottom(x).tickFormat(d3.format("d")).tickSizeOuter(0))
  .call((gAxis) => gAxis.selectAll("text").attr("font-size", 10));

// å·¦ä¾§åˆ†ç»„æ ‡ç­¾ï¼ˆæ¯ä¸ªä¸»ç±»ä»…åœ¨å…¶ç¬¬ä¸€æ¡å­ç±»ä¸Šæ–¹ï¼‰
g.selectAll(".group-label")
  .data(categories)
  .enter()
  .append("text")
  .attr("class", "group-label")
  .attr("x", -margin.left + 12)
  .attr("y", (d) => {
    const firstRowKey = subcats.find((s) => s.startsWith(d));
    const base = y(firstRowKey);
    return (base ?? 0) - 12;
  })
  .attr("fill", "#333")
  .attr("font-weight", "bold")
  .attr("font-size", 13)
  .text((d) => d);

// ===============================
// ğŸ¹ ç»˜åˆ¶æ¡å½¢ + Tooltip
// ===============================
const bands = g.selectAll(".genre")
  .data(allGenres)
  .enter()
  .append("g")
  .attr("class", "genre");

bands
  .append("rect")
  .attr("x", (d) => x(d.start))
  .attr("y", (d) => y(`${d.category} â€º ${d.subcategory}`))
  .attr("width", (d) => Math.max(1, x(d.end) - x(d.start)))
  .attr("height", y.bandwidth() * 0.78)
  .attr("fill", (d) => color(d.category))
  .attr("rx", 3)
  .on("mousemove", (event, d) => {
    tooltip
      .style("display", "block")
      .style("opacity", 1)
      .style("left", event.pageX + 14 + "px")
      .style("top", event.pageY - 40 + "px")
      .html(
        `<strong>${d.name}</strong><br>
         ğŸ“… å¹´ä»£ï¼š${d.start}â€“${d.end}<br>
         â³ æŒç»­æ—¶é—´ï¼š${d.duration} å¹´<br>
         ğŸ·ï¸ ç±»åˆ«ï¼š${d.category} â€º ${d.subcategory}<br>
         ğŸŒ åœ°åŒºï¼š${d.location}<br>
         ğŸ¶ èµ·æºï¼š${d.origin || "æœªçŸ¥"}`
      );
  })
  .on("mouseout", () => {
    tooltip.transition().duration(120).style("opacity", 0).on("end", () => {
      tooltip.style("display", "none");
    });
  });

// ===============================
// ğŸ·ï¸ æ™ºèƒ½æ ‡ç­¾ï¼ˆé™æµ + çœç•¥ï¼‰
// ===============================
const maxLabels = 60;
const step = Math.max(1, Math.ceil(allGenres.length / maxLabels));
const ellipsis = (s, n = 18) => (s && s.length > n ? s.slice(0, n - 1) + "â€¦" : s);

bands
  .append("text")
  .filter((_, i) => i % step === 0)
  .attr("x", (d) => x(d.end) + 6)
  .attr("y", (d) => y(`${d.category} â€º ${d.subcategory}`) + y.bandwidth() * 0.6)
  .attr("fill", "#2d2d2d")
  .attr("font-size", 10)
  .text((d) => ellipsis(d.name));

// ===============================
// ğŸ§­ å›¾ä¾‹ï¼ˆä»… Folk / Popularï¼‰
// ===============================
legendContainer.html(""); // å…ˆæ¸…ç©º
const legendGroup = legendContainer
  .selectAll(".legend-group")
  .data(categories)
  .enter()
  .append("div")
  .attr("class", "legend-group")
  .style("margin", "8px 12px")
  .style("display", "inline-block");

legendGroup
  .append("div")
  .style("font-weight", "bold")
  .style("margin-bottom", "4px")
  .text((d) => d);

legendGroup.each(function (cat) {
  const subs = Array.from(
    new Set(allGenres.filter((d) => d.category === cat).map((d) => d.subcategory))
  );
  const groupDiv = d3.select(this);
  groupDiv
    .selectAll(".legend-item")
    .data(subs)
    .enter()
    .append("div")
    .attr("class", "legend-item")
    .style("display", "flex")
    .style("align-items", "center")
    .style("font-size", "12px")
    .style("color", "#444")
    .html(
      (d) =>
        `<span style="display:inline-block;width:10px;height:10px;background:${color(
          cat
        )};border-radius:2px;margin-right:6px"></span>${d}`
    );
});
